import { Sidebar } from '../components/Sidebar/Sidebar';
import { Button } from '@material-ui/core';



export const User = () => {
    return (
        <>
            <div className="falla">
                <Sidebar />
                <div className="user">
                    <div className="userLogin">
                        <div className="loginDetails">
                            <span className="loginTitle">Bienvenido,
                            carnavalero</span>
                            <div><span>See all the new features we’ve added through our tutorial.</span></div>
                        </div>

                        <div className="loginButtons">
                            <Button variant="contained" color="primary" >Registrarse</Button>
                            <Button variant="contained" color="primary">Iniciar sesión</Button></div>
                    </div>
                </div>
            </div>
        </>
    );
}
